Currently Draft
Bob the Developer Swift Styling Guide

Reference
WWDC: Swift API Design Guidelines: 
The Swift Programming Language (Swift 3.1)
SwiftFormat
The Official raywenderlich.com Swift Style Guide
Swift Blog: API Design Guidlines
What Swift Engineers Believe
Clarity at the point of use is your most important goal. Entities such as methods and properties are declared only once but used repeatedly. Design APIs to make those uses clear and concise. When evaluating a design, reading a declaration is seldom sufficient; always examine a use case to make sure it looks clear in context.
Clarity is more important than brevity. Although Swift code can be compact, it is a non-goal to enable the smallest possible code with the fewest characters. Brevity in Swift code, where it occurs, is a side-effect of the strong type system and features that naturally reduce boilerplate.
Write a documentation comment for every declaration. Insights gained by writing documentation can have a profound impact on your design, so don’t put it off.
Promote Clear Usage
Include all the words needed to avoid ambiguity for a person reading code where the name is used.
extension List {
  public mutating func remove(at position: Index) -> Element
}
employees.remove(at: x)

employees.remove(x) // unclear: are we removing x?

Omit needless words
In particular, omit words that merely repeat type information.
public mutating func removeElement(_ member: Element) -> Element?
allViews.removeElement(cancelButton)

public mutating func remove(_ member: Element) -> Element?

allViews.remove(cancelButton) // clearer

Name variables, parameters, and associated types according to their roles, rather than their type constraints.
var string = "Hello"
protocol ViewController {
  associatedtype ViewType : View
}
class ProductionLine {
  func restock(from widgetFactory: WidgetFactory)
}

var greeting = "Hello"
protocol ViewController {
  associatedtype ContentView : View
